import { Component, Input, OnInit,Pipe } from '@angular/core';
import { DataService } from '../data-services/supplier-data';
import { ISupplierInformation,GSTStateCode,CopyType, Buyer, Detail, HSNS } from '../model';
import * as bill from "../utility"
@Component({
  selector: 'app-supply-report',
  templateUrl: './supply-report.component.html',
  styleUrls: ['./supply-report.component.css']
})
export class SupplyReportComponent implements OnInit {
  
  @Input()
  public supplier?:ISupplierInformation;
  
  @Input()
  public buyer?:Buyer;
  
  @Input()
  public billDetail!:Detail;

  @Input()
  public copyInfo:CopyType=0;

  GSTCode = GSTStateCode;
  CopyEnum = CopyType;
  util=bill;
  HSNS = HSNS;
  dateFormatOptions={ year: 'numeric', month: 'short', day: 'numeric' };
  dateCulture="en-GB";
  billDate = new Date();
  _sStateCode:number;
  _bStateCode:number;
  _bState?:string="";
  _actBStateCode?:string="";
  
  constructor(private _data:DataService){
    this.supplier= _data.getSupplierInformation()[0];
    
    this._sStateCode = this.supplier?.stateCode ?? 9;
  
    this._bStateCode = this.buyer?.stateCode ?? 9;
  }

  joinPaddString(value:string){
    var _items = value.split(',');
    for(let i=0;i<_items.length;i++){
      _items[i] = bill.padNumber(parseInt(_items[i]),'0',5);
    }
    return _items.join(', ');
  }
  getTotalSum(){
    var _total =0;
     let _items = this.billDetail.items;
     for(let i=0;i<_items.length;i++){
       if(_items[i].rate !=0 && _items[i].weight ){
        _total +=  _items[i].rate * _items[i].weight;
       }
     }
     return _total;
  }
  ngOnInit(): void {
  }

  ngAfterViewInit(){
    this._bStateCode  = parseInt(this.buyer.GSTIN.slice(0,2));
    this._bState = this.GSTCode[this._bStateCode];
    this._actBStateCode = this.util.padNumber(this._bStateCode,'0',2);
    console.log(this._bStateCode, this.buyer?.stateCode,this.buyer?.GSTIN);
  }

  ganeshaImage='data:image/jpeg;base64,';

}
